            super(props);
            this.state = {

            }
        }


    render(){
        return(
            <div>
                <header className="header">
                    <nav className="navbar navbar-expand-lg bg-yellow navbar-dark  before-toggle-icon">
                        <div className="col-md-3">
                            <img src={logo} width="20"/>
                            <span className="text-logo">italk</span>
                        </div>
                        <div className="col-md-5">
                        <ul className="nav">
  <li className="nav-item">
    <a className="nav-link" href="#">Link</a>
  </li>
  <li className="nav-item">
    <a className="nav-link" href="#">Link</a>
  </li>
  <li className="nav-item">
    <a className="nav-link" href="#">Link</a>
